{"0": ["Чууууудесные серьги. Настолько милые, что сама бы их одела. Очень аккуратные, маловесные. Нет острых выступающих частей-не будут задевать ни за что. Очень довольна. Благодарю! ", "2018-12-13T17:09:54.173957609Z", "золотистый", "0              ", 2, 1, 5, "Серьги", "Серебро России"], "2": ["Серёжки действительно очень нежные, хрупкие. Камушки малюсенькие, отсутствие 4х шт обнаружила в солнечном свете, при комнатном было не видно. Написала претензию, её не обрабатывали 6 дней. После того, как начала везде писать, чтобы на меня обратили внимание, быстренько прислали отказ. Я осталась с бракованными серёжками, куда их теперь? Без денег. Больше никогда не буду связываться с мелкой ювелиркой. И вам не рекомендую.", "2020-08-09T14:34:55Z", "золотистый", "0", 1, 0, 1, "Серьги", "Серебро России"], "4": ["Очень хлипкие, быстро сломались, когда 6-летний ребёнок их самостоятельно снимал. ", "2020-07-16T07:54:13.245757225Z", "золотистый", "0", 1, 1, 2, "Серьги", "Серебро России"], "6": ["Все камни на месте. Замки защелкиваются. На 5лет, высокий прокол и пухлую мочку сели норм. От золотых не отличишь, интересно как покрытие себя поведёт.", "2020-01-27T11:59:12.60017078Z", "золотистый", "0", 1, 0, 5, "Серьги", "Серебро России"], "7": ["Не прошло и полгода, как развалились. Очень хлипкие(тонкие). А внешне очень красивые.", "2020-01-15T13:02:44.036167851Z", "золотистый", "0", 1, 0, 2, "Серьги", "Серебро России"], "9": ["Серёжки очень мелкие, тонкие, замок не держит. В первый же день потеряли. Дочка носит \"Соколов\",  ни одну серьгу не потеряла. Качество ноль", "2019-10-27T17:19:38.00379119Z", "золотистый", "0", 1, 1, 1, "Серьги", "Серебро России"], "10": ["Пришли со сломанной застежкой! Ребёнок расстроился, перезаказали. Прошу не снижать процент выкупа.", "2019-09-29T04:49:41.710432192Z", "золотистый", "0", 1, 0, 1, "Серьги", "Серебро России"], "11": ["Сережки пришли с браком, погнутые дужки.", "2019-09-18T16:22:27.34731681Z", "золотистый", "0", 1, 0, 5, "Серьги", "Серебро России"], "12": ["Серьги оказались погнутые, причем самая важная и красивая часть серьги- фасад. Выкупать не стала. Хорошо, что предварительно почитала отзывы и заказала 2 одинаковые пары серёжек.", "2019-09-03T08:14:45.573492448Z", "золотистый", "0", 1, 0, 1, "Серьги", "Серебро России"], "15": ["Чудесные сережечки!божья коровка как настоящая!милые и очень нежные)хорошая застежка,камушки все на месте", "2019-06-10T12:15:47.889340929Z", "золотистый", "0", 2, 0, 5, "Серьги", "Серебро России"], "18": ["Милые сережки. Через несколько месяцев в носке ослаб замок на одной серьге, не починить.", "2019-04-21T21:45:32.855932142Z", "золотистый", "0", 1, 0, 4, "Серьги", "Серебро России"], "19": ["Качество ужасное. Фианитики отпали ещё в упаковке (фото 2), хотела сдать как брак, но дочь попросила оставить. Камешки мелкие, отсутствие не особо заметно. Через пару дней одна из серёжек местами потеряла золотистый цвет (фото 1). Застежка хлипкая. Из плюсов только симпатичный внешний вид. Однозначно не рекомендую даже за 500 рублей.", "2019-02-27T12:35:16.278320285Z", "золотистый", "0", 3, 1, 1, "Серьги", "Серебро России"], "22": ["Миленькие серьги для девочки маленькой ) лет так до 4-5 хватит ", "2018-11-16T08:15:47.3591506Z", "золотистый", "0", 1, 1, 5, "Серьги", "Серебро России"], "23": ["Сережки хорошенькие,но пришли сильно погнутые и не хватало одного фианита.Отказ. Буду перезаказывать", "2018-10-22T14:00:31.894620794Z", "золотистый", "0", 1, 0, 3, "Серьги", "Серебро России"], "24": ["Серьги красивые. Но мне не повезло, погнуты застежки и из-за этого серьги не закрываются. Поэтому отказ.", "2018-09-22T11:59:01.859066236Z", "золотистый", "0", 2, 1, 2, "Серьги", "Серебро России"], "25": ["Очень симпатичные! Хорошо, что заказывала 2 пары, в одной серьге не хватало фианитика. Замки рабочие, легкие, согласно весу)))))))", "2018-07-16T08:00:06.566972843Z", "золотистый", "0", 3, 0, 5, "Серьги", "Серебро России"]}
